import styled from "styled-components";

export const Section = styled.div`
  margin-top: 1rem;
  padding: 1rem;
  background-color: rgb(235, 195, 64);
  position: fixed;
  bottom: 0;
  left: 0;
  width: 100%;
  height: 2rem;
`;

export const Icons = styled.div``;
